import React from 'react';
import style from './NavBar.module.css';
import { NavLink } from 'react-router-dom';


export default function NavBar () {


    return (

        <header class="header">
            <a href="#" class="logo">j0ak!</a>

            <nav class="navbar">
                <NavLink to={'/Home'} className={style.inicio}>
                    <button className={style.btn}>Home</button>
                </NavLink>
                <a href="#home" class="act">Home</a>
                <a href="#about">About</a>
                <a href="#services">Technologies</a>
                <a href="#portfolio">Portfolio</a>
                <a href="#contact">Contact</a>
            </nav>

            <div class="bx bx-moon" id="darkIcon"></div>

            <div class="bx bx-menu" id="menu-icon"></div>
        </header>
        // <nav className={style.container}>
            // <NavLink to={'/Home'} className={style.inicio}>
            //     <button className={style.btn}>Home</button>
            // </NavLink>
        //     <NavLink to={'/Recipes'} className={style.cards}>
        //         <button className={style.btn}>Recipes</button>
        //     </NavLink>
        //     <NavLink to={'/Diets'} className={style.favorites}>
