        //     </NavLink>
        //     <NavLink to={'/Favorites'} className={style.favorites}>
        //         <button className={style.btn}>Favorites</button>
        //     </NavLink>
        //     <NavLink to={'/About'} className={style.about}>
        //         <button className={style.btn}>About</button>
        //     </NavLink>
        // </nav>
    )
}
